import './TalkAbout.css';
import './TalkAbout_responsive.css';
const TalkAbout = () => {
    return(
        <div className="TalkAbout">
            <div className='section-header'>
                <span>WE'RE HERE TO HELP</span>
                <h2>Let's Talk About Your New Project, We Can Do It!</h2>
            </div>
            <button className='btn btn-light'>CONTACT US</button>
        </div>
    )
}
export default TalkAbout;
